import React from "react";
import "./App.css";
import Aux from "../src/com/fplan/hoc/Aux";
import HeaderImages from "../src/com/fplan/components/images/header/HeaderImages";

function App() {
  return (
    <Aux>
      <div className="App">
        <HeaderImages></HeaderImages>
      </div>
    </Aux>
  );
}

export default App;
